INSERT INTO `blogs` (`id`, `name`, `description`, `content`, `created_at`, `updated_at`) VALUES
	(2, 'ELLE FASHION SHOW 2023: VẺ ĐẸP THỜI TRANG, KIẾN TRÚC, DI SẢN CÙNG HỘI TỤ', 'Trong buổi chiều nắng đẹp ngày 20/12/2023, ELLE Fashion Show 2023 như một người đẹp kết nối những tinh hoa nghệ thuật đẹp đẽ, từ sự mềm mại của thời trang, các hình khối đa sắc của kiến trúc, và cuối cùng là không gian đậm chất văn hóa lịch sử Dinh Độc Lập. Không đơn giản là buổi trình diễn, ELLE Fashion Show 2023 như một tuyên ngôn sâu sắc về sự kết nối liên ngành cùng tinh thần kế thừa văn hóa và tôn vinh cái đẹp.', 'Là sự kiện thời trang được mong đợi nhất trong năm, ELLE Fashion Show không chỉ là cầu nối để giới thiệu những BST mới nhất của các NTK và thương hiệu nổi bật, mà còn gửi gắm nhiều thông điệp cấp tiến, thức thời, gắn liền với bối cảnh xã hội. Tiếp nối sứ mệnh của mình, ELLE Fashion Show 2023: Giao lộ kiến trúc và thời trang tiếp tục đưa đến công chúng các BST của 4 thương hiệu nổi tiếng là Truong Thanh Hai, Khaar, Luu VietAnh, và Peggy Hartanto.  Điểm nhấn đặc biệt tại ELLE Fashion Show 2023 là khúc giao hưởng của thời trang và kiến trúc – hai lĩnh vực vốn song hành cùng nhau trong hành trình khai phá, biến đổi các chất liệu, hình khối, màu sắc và chuyển động để trở thành tác phẩm nghệ thuật chạm đến trái tim mỗi người. Càng ý nghĩa hơn, khi giao lộ thời trang- kiến trúc được tổ chức tại Dinh Độc Lập – một biểu tượng của lịch sử, văn hóa Việt Nam với kiến trúc hoành tráng đan xen giữa nét truyền thống Phương Ðông và nghệ thuật hiện đại.', '2024-01-04 09:48:01', '2024-01-04 14:03:14'),
	(3, 'HERMÈS “WISH-LIST”: CHO CHÀNG, CHO NÀNG, CHO NHỮNG NGƯỜI THƯƠNG', 'Gợi ý tặng phẩm từ Hermès cho mùa Lễ hội năm nay bao gồm những vật phẩm độc đáo nằm trong BST mang tên “Object”, được thương hiệu sáng tạo để tri ân di sản trên lưng ngựa.', 'Khi những ca khúc bất hủ của Mariah Carrey và Michael Buble đang dần được “rã đông”, bạn biết mùa Lễ hội cuối năm đã gần kề. Đến hẹn lại lên, những vật phẩm đáng mơ ước của Hermès cũng trở lại ‘wishlist’ mà nhiều người đang hào phóng lập nên cho gia đình và những người thân yêu.', '2024-01-04 09:49:11', '2024-01-04 09:49:11'),
	(4, 'DISNEY X VANS 2023 – BST GIÀY SIÊU SAO CHÍNH HÃNG CHÍNH THỨC ĐỔ BỘ VIỆT NAM ĐÁNH DẤU 100 NĂM THÀNH LẬP DISNEY', 'Khác với việc lựa chọn nhiều nhân vật “phản diện” trong loạt phim trước, lần này BST Disney x Vans sẽ vinh danh những nhân vật kinh điển được người hâm mộ yêu thích.', 'Tác phẩm kinh điển Disney yêu thích của bạn là gì? Những con vật siêu dễ thương như “Vua sư tử”, “Bambi”, “Dumbo”, “Lady and the Tramp”, hay “Bạch Tuyết”, “Cô bé lọ lem”, “Người đẹp và quái vật”, ” Nàng tiên cá”… Hay bạn chỉ yêu thích BOSS phản diện siêu xấu quyến rũ? Cho dù bạn nghĩ đến bộ phim hay nhân vật nào thì năm nay cũng sẽ có một cuộc đại náo lớn cho dịp kỷ niệm 100 năm thành lập Disney. Khác với việc lựa chọn nhiều nhân vật “phản diện” trong loạt phim trước, lần này Disney x Vans sẽ vinh danh những nhân vật kinh điển được người hâm mộ yêu thích. Ba nhân vật nổi tiếng có thể đại diện cho Disney sẽ được chọn lọc và lồng ghép vào các sản phẩm giày kinh điển của Vans là chủ đề của câu chuyện được kể trên giày.', '2024-01-04 09:49:57', '2024-01-04 09:49:57'),
	(5, 'KENZO HỢP TÁC CÙNG VERDY – GIÁM ĐỐC NGHỆ THUẬT WORLD TOUR BLACKPINK TRONG BST MỚI', 'Nếu vẫn chưa hết ấn tượng trước độ hoành tráng, công phu của World Tour BLACKPINK kéo dài suốt năm 2022 – 2023 thì bạn hẳn sẽ rất hứng thú khi biết nghệ sĩ Verdy – giám đốc nghệ thuật của Born Pink – sẽ hợp tác cùng Kenzo trong BST mới.', 'Kenzo và Giám đốc nghệ thuật Nigo mới đây đã thông báo hợp tác cùng Verdy – nghệ sĩ đồ họa trẻ tuổi tài năng, người đã rất thành công với vai trò giám đốc nghệ thuật của tour diễn Born Pink cũng như đồ họa cho show Xuân-Hè 2024. Verdy đồng thời cũng là một người bạn thân thiết của Nigo, được đương đại yêu mến bởi các tác phẩm mang hơi thở đường phố Nhật Bản giao hòa cùng phong cách phương Tây, kết hợp nhuần nhuyễn hip hop và manga. Cũng do đó, Verdy trở thành sự bổ sung sáng tạo hoàn hảo cho bầu không khí Đông-Tây đặc trưng của Kenzo.', '2024-01-04 09:50:56', '2024-01-04 09:50:56');
