	(397, 'Đầm hai dây, Dáng thắt eo 23SDKU011X', '23SDKU011X', 7, '\n												<div>Đầm hai dây ôm eo suông thẳng có đường cắt ngang eo, hoa được làm bằng vải chính tạo điểm nhấn, phần thân dưới suông dài có xẻ lệch một bên.</div><div>Màu sắc: Xanh</div><div>Chất liệu: Rayol</div><div>&nbsp;</div><div>Do màn hình và điều kiện ánh sáng khác nhau, màu sắc thực tế của sản phẩm có thể chênh lệch 2-5% so với màu thật của sản phẩm, quý khách vui lòng thông cảm! Sản phẩm không kèm phụ kiện mix&amp;match.</div><a href="https://evadeeva.com.vn/pages/huong-dan-bao-quan-giat-la">Hướng dẫn bảo quản, giặt là</a>&nbsp;\n											', 1199700, 40, 47, 40, NULL, NULL, 70, 'Eva De Eva', 0, NULL, '"[\\"xanh\\",\\"\\\\u0111\\\\u1ecf\\"]"', '2023-11-25 09:23:31', '2023-11-25 09:23:31'),
	(398, 'Đầm sát nách, Dáng A 23SDKU010T', '23SDKU010T', 7, '\n												Đầm chi tiết cổ tròn khít, tay sát nách, kéo khóa sau, dáng xòe A.<div>Màu sắc: Trắng</div><div>Chất liệu: Tuýt-si</div><div>&nbsp;</div><div>&nbsp;</div><div>Do màn hình và điều kiện ánh sáng khác nhau, màu sắc thực tế của sản phẩm có thể chênh lệch 2-5% so với màu thật của sản phẩm, quý khách vui lòng thông cảm! Sản phẩm không kèm phụ kiện mix&amp;match.</div><div><a href="https://evadeeva.com.vn/pages/huong-dan-bao-quan-giat-la">Hướng dẫn bảo quản, giặt là</a></div>\n											', 1499700, NULL, NULL, NULL, NULL, NULL, 70, 'Unique', 0, NULL, '"[\\"xanh\\",\\"\\\\u0111\\\\u1ecf\\"]"', '2023-11-25 09:23:31', '2023-11-25 09:23:31'),
	(399, 'Đầm sát nách, Dáng ôm 23SDKU005T', '23SDKU005T', 7, '\n												Đầm chi tiết cúp ngực, cổ tròn khít, tay sát nách, kéo khóa sau, dáng ôm midi, xẻ sau.<div>Màu sắc: Trắng</div><div>Chất liệu: Tuýt-si</div><div>&nbsp;</div><div>Do màn hình và điều kiện ánh sáng khác nhau, màu sắc thực tế của sản phẩm có thể chênh lệch 2-5% so với màu thật của sản phẩm, quý khách vui lòng thông cảm! Sản phẩm không kèm phụ kiện mix&amp;match.</div><div><a href="https://evadeeva.com.vn/pages/huong-dan-bao-quan-giat-la">Hướng dẫn bảo quản, giặt là</a></div>\n											', 1049700, NULL, NULL, NULL, NULL, NULL, 70, 'Unique', 0, NULL, '"[\\"xanh\\",\\"\\\\u0111\\\\u1ecf\\"]"', '2023-11-25 09:23:31', '2023-11-25 09:23:31'),
	(400, 'Chân váy Midi, Dáng A 23SCVU002D', '23SCVU002D', 7, '\n												<div>Chân váy A công sở dáng dài midi, 2 hàng cúc, chi tiết lớp ngoài bất đối xứng, kết cấu mới lạ.</div><div>Màu sắc: Đen</div><div>Chất liệu: Linen</div><div>&nbsp;</div><div>Do màn hình và điều kiện ánh sáng khác nhau, màu sắc thực tế của sản phẩm có thể chênh lệch 2-5% so với màu thật của sản phẩm, quý khách vui lòng thông cảm! Sản phẩm không kèm phụ kiện mix&amp;match.</div><a href="https://evadeeva.com.vn/pages/huong-dan-bao-quan-giat-la">Hướng dẫn bảo quản, giặt là</a>&nbsp;\n											', 749700, NULL, NULL, NULL, NULL, NULL, 70, 'Eva De Eva', 0, NULL, '"[\\"xanh\\",\\"\\\\u0111\\\\u1ecf\\"]"', '2023-11-25 09:23:32', '2023-11-25 09:23:32'),
